import React from 'react'
import {makeStyle, makeStyles} from "@material-ui/styles"
import {Typography, Box, Grid, Avatar} from "@material-ui/core"
import Navbar from "./Navbar";
import silas_image from"../images/Silas.jpg"

const useStyle = makeStyles({
    container : {
        background:"tomato",
        width: "40%",
        alignContent:"center",
        margin: "auto",   
        padding: "10px",             
    },
    silasIcon:{
        width: "7rem",
        height : "7rem",
    },
    info:{
        paddingLeft:"30px",
    },
    line:{
        border:  "red"
    }

}) 

export const Resume = () => {
    const classes = useStyle()
    return (
        <div>
           <Navbar/>
           <Grid container spacing={3} className={classes.container}>
               <Grid item xs={4}  >
                   <Avatar src={silas_image} className={classes.silasIcon}/>
               </Grid>
               <Grid item xs={8} className={classes.info}>
                   <Typography variant="h5" >SILAS</Typography>
                   <Typography variant="h7" >Web Programmer</Typography>
                   <hr class="line"/>
                   <Typography variant="h6" >About Me</Typography>
                   <Typography variant="p" >Hi, It is my Resume, please contact me for getting more information</Typography>
               </Grid>
           </Grid>
        </div>
    )
}

export default Resume;
